import React from "react";

const Footer = () => {
  return (
    <footer className="footer">
      <h3>Footer</h3>
      <div className="row footer__icons-box">
        <div>
          <a href="">
           
            <i class="fa fa-snapchat" aria-hidden="true"></i>

          </a>
        </div>
      </div>
    </footer>
  );
};
export default Footer;
